    false,nt"url": null,nt"notes": "Prior to harvest reporting, Iowa had a
    long history of using postcard surveys to estimate the harvest of deer and turkeys.
    However, these surveys were slow and cumbersome, and often didn't provide reliable
    information about deer and turkey harvest at the county level. The harvest reporting
    system provides harvest information much faster, and with a much higher level of
    detail. This leads to more responsive management of our deer and turkey populations.
     All successful deer and turkey hunters must report each deer and/or turkey they
